  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is one component of a digital
  orthophoto coverage (D! OI) over the Southwest Florida Water Management District
  (SWFWMD) North District Project Area. This dataset is comprised of color DOI cells
  in a Geotiff format, at a 1-foot pixel resolution, based on the District 5,000'
  x 5,000' tile system. This dataset was created from source imagery acquired through
  the Leica ADS40 multispectral scanner during the Winter of 2006. There are a total
  of 4,041 cells (tiles) encompassing +/-3,624 square miles in all or parts of Citrus,
  Hernando, Lake, Levy, Marion, Pasco, and Sumter counties. The companion datasets
  to this coverage include color infrared DOI at the same pixel resolution and geographic
  extents as the color DOI dataset and a dataset comprised of the original imagery
  mosaic lines with dates of imageyr acquisition in the ESRI shapefile format.\",\n\t\"owner_org\":
